import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useSelector , useDispatch } from "react-redux"; 
import { setLogout } from "../state/index";
import { IconButton, AppBar, Toolbar,} from '@mui/material';
import {makeStyles} from "@mui/styles"
import HomeIcon from '@mui/icons-material/Home';
import InfoIcon from '@mui/icons-material/Info';
import WorkIcon from '@mui/icons-material/Work';
import ContactMailIcon from '@mui/icons-material/ContactMail';
import PersonIcon from '@mui/icons-material/Person';

export default function Navbar() {
  const bgColor = {
    backgroundColor: "#f0f4f8",
  };

  const navigate = useNavigate();
  const dispatch = useDispatch(); // Get the dispatch function from Redux

  const isLoggedIn = useSelector((state) => state.token !== null);
  const handleLogout = () => {
    // Dispatch the setLogout action to update Redux state
    dispatch(setLogout());
    navigate("/");
  };
  const useStyles = makeStyles((theme) => ({
    iconButton: {
      color: theme.palette.indigo['700'],
      '&:hover': {
        color: theme.palette.indigo['600'],
        borderBottom: `2px solid ${theme.palette.indigo['700']}`,
      },
      fontSize: '2rem', // Increase the icon size
    },
    selected: {
      color: theme.palette.indigo['700'],
      borderBottom: `2px solid ${theme.palette.indigo['700']}`,
    },
  }));
  // const classes = useStyles();
  return (

    <div style={bgColor}>
      <div className="container-fluid">
        <header className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3  border-bottom">
          <div className="col-md-3 mb-2 mb-md-0">
            <Link
              to="/home"
              className="d-inline-flex link-body-emphasis text-decoration-none"
            >
              <img
                src="/logo-removebg-preview.png"
                alt="Logo"
                width={40}
                height={40}
              ></img>
              <span className="fs-4 text-indigo-600 font-semibold">
                कृषि-मित्र
              </span>
            </Link>
          </div>


          <Toolbar>
        {isLoggedIn ? (
          <div>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/home"
            >
              <HomeIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/about"
            >
              <InfoIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/services"
            >
              <WorkIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/contact"
            >
              <ContactMailIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/profile/:userId"
            >
              <PersonIcon />
            </IconButton>
          </div>
        ) : (
          <div>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/home"
            >
              <HomeIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/about"
            >
              <InfoIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/services"
            >
              <WorkIcon />
            </IconButton>
            <IconButton
              className={classes.iconButton}
              classes={{ selected: classes.selected }}
              component={Link}
              to="/contact"
            >
              <ContactMailIcon />
            </IconButton>
          </div>
        )}
      </Toolbar>


          <div className="col-md-3 text-end">
            {isLoggedIn ? (
              <div>
                <Link
                  to="/create-blog"
                  type="button"
                  className="position-relative justify-center border-indigo-600 border-1 rounded-md  px-3 mx-3 py-1.5 text-sm font-semibold leading-6 text-indigo-600 shadow-sm hover:text-white hover:bg-indigo-600  focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                >
                  + New{" "}
                  <span className="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-danger"></span>
                </Link>

                <Link
                  to="/"
                  type="button"
                  className="justify-center rounded-md bg-indigo-600 px-3 py-1.5 text-sm font-semibold leading-6 text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                  onClick={handleLogout}
                >
                  Logout
                </Link>
              </div>
            ) : (
              <div>
                <Link
                  to="/"
                  type="button"
                  className="justify-center border-indigo-600 border-1 rounded-md px-3 mx-3 py-1.5 text-sm font-semibold leading-6 text-indigo-600 shadow-sm hover:text-white hover:bg-indigo-600 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                >
                  Login
                </Link>
                <Link
                  to="/signup"
                  type="button"
                  className="justify-center rounded-md bg-indigo-600 px-3 py-1.5 text-sm font-semibold leading-6 text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                >
                  Register
                </Link>
              </div>
            )}
          </div>
        </header>
      </div>
    </div>
  );
}
